import React from "react";
import { Router, Switch, BrowserRouter, Link, withRouter } from "react-router-dom";
import "./App.css";
import Home from "./Home";
import About from "./About";
import Products from "./Products";
import { Nav, Navbar, Button } from "react-bootstrap";
import Navigation from "./Navigation";


function App() {
  return (
    <div>
      <React.Fragment>
        <Router>
          <Navigation/>
        </Router>
      </React.Fragment>
    </div>
  );
}

export default App;
